import './App.css';

function App() {
  const name = <h1>Nitish</h1>
  const age = <h1>20</h1>
  const email = <h1>nitish@gmail.com</h1>

  const user = (
    <div>
      {name}
      {email}
      {age}
    </div>
  );
  return (
    <div className="App">
      <div>
        {name}
        {age}
        {email}
      </div>

      <div>
        {user}
      </div>

      <div>
        {user}
      </div>

    </div>
  );
}


